import React from "react";
import {connect} from 'react-redux'
import * as actions from '../actions'
import { Button } from 'semantic-ui-react'
import { Tab } from 'semantic-ui-react'



class TodoList extends React.Component {


    render() {
        console.log(this.props);
        const panes = [
            { menuItem: 'Tab 1', render: () => <Tab.Pane>Tab 1 Content</Tab.Pane> },
            { menuItem: 'Tab 2', render: () => <Tab.Pane>Tab 2 Content</Tab.Pane> },
            { menuItem: 'Tab 3', render: () => <Tab.Pane>Tab 3 Content</Tab.Pane> },
        ];
        const TabExampleLoading = () => <Tab panes={panes} />

        return (

            this.props.todoList.map((todo) =>

                <div>
                    <div className="ui attached tabular menu">
                        <a className="active item">Tab 1</a>
                        <a className="item">Tab 2</a>
                        <a className="item">Tab 3</a>
                    </div>
                    <div className="ui bottom attached segment active loading tab">Tab 1 Content</div>
                </div>
                            )
        );
    }

}

const mapStateToProps = state => {
    return {
        todoList: state.TodoList,
        completeListArray: state.CompleteList
    }
};
export default connect(mapStateToProps, actions)(TodoList);
